import React from 'react';
import Header from './components/header';
import Home from './components/home';
import View from './components/view';
import {BrowserRouter as Router,Switch,Route} from "react-router-dom";


function App() {
  return (
    <Router>
      <Header/>
      <View/>
      <Switch>
        <Route>
          <Home path="/" />
        </Route>
        <Route>
          <View path="/view"/>
        </Route>
        </Switch>  
    </Router>
  );
}

export default App;
